                        <div class="slide__text">
                            <h2 class="slide__text-heading">Rann of Kutch</h2>
                            <p class="slide__text-desc">Kutch, located in the State of Gujarat,is blessed with one of the most ecologically and culturally abundant landforms. The brimming profusion of nature’s beauty, culture and tradition, superfluity of colors and celebration, cornucopia of joy and beauty, all together reflect the magnificence of the kaleidoscopic Kutch. Particularly, the spectacular sight of boundless white desert under the moonlightpresents the stunning creation of nature, unique to this world.</p>
        
