        <div class="col-lg-6  text-justify">
        <h1 class="shead-style text-center">GUJARAT</h1>
        <p>A jewel in the western side this land of merchants is very important and holy  for the whole of india. Housing some of the most important and beautiful piligrimage sites and a hub for infrastructure Gujarat has held it’s head high for more a thousand years. The scenic western landscapes and the aravallis provide a picturesque encounter.</p><p>
        Having many Hindu temples and jai temples this place is also a houses many architectural wonders ranging from temples to palaces. While not much of the land is very wet in comparison to rest of the India its natural beauty is one of its kind. The Rann of Kutch which is sparsely populated is a hub for a wide range of birds and animals. Whether from a traveller’s perspective or from a tourists perspective Gujarat never fails to amaze the eyes of a visitor.
        </p>
